            .is(":visible")) {
            cy.wrap("inactive").as("finalStatus");
        }
        else if ($EditScreen
            .find('p[class="active body_b16 ng-star-inserted"]')
            .is(":visible")) {
            cy.wrap("active").as("finalStatus");
        }
        else {
            cy.log("No Activation is Visible in Edit Screen");
